  false,\n\t\"url\": null,\n\t\"notes\": \"Waterfowl production objectives, according
  to the Iroquois National Wildlife Refuge Master Plan, are to create habitat supporting
  the production of 8,000 ducks and 1,000 geese annually. These production objectives
  cannot be attained without limited predator control, especially during the nesting
  season. Other game birds such as the woodcock, mourning dove, ring-necked pheasant,
  and ruffed grouse will also benefit from limited predator control. Another major
  refuge objective is to promote nature- oriented recreation. The public must be protected
  while taking part in such recreation as hiking on nature trails, bird-watching,
  etc. Thus, limited predator control is necessary to prevent fox population from
  becoming large enough to be a serious menace in the case of a rabies outbreak.\",\n\t\"owner_org\":
